import React from "react";
import "../styles/sidebar.css";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-title">
        <span id="sidebar-name">
          <p>Garret</p>
          <p>Sweetwood</p>
        </span>
        Full Stack Developer
      </div>
    </div>
  );
};

export default Sidebar;
